import React, { useEffect } from 'react';
import './css/Home.css';

import gsap from 'gsap';

function Home() {
  useEffect(() => {
    gsap.to('#title', {
      opacity: 1,
      duration: 3
    });
  });
  return (
    <div>
      <div className="container">
        <h1 className="title" id="title">
          WELCOME MY PORTFOLIO
        </h1>
        <div className="linkBox">
          <a href="#" className="link">
            ENTER
          </a>
        </div>
      </div>
    </div>
  );
}

export default Home;
